import React from 'react';
import './App.css';
import {BrowserRouter, Route} from "react-router-dom";
import Header from './Component/Header/Header';
import Footer from './Component/Footer/Footer';
import Slide from './Component/Slide/Slide';
import NavContainer from './Component/Nav/NavContainer';

function App() {
  return (
    <BrowserRouter>
      <div className="app-wrapper">
        <div className="Blue">
          <div className="Top">
            <Header />
            <Slide />
          </div>
        </div>
        <div className="White">
          <div className="Center">
            <NavContainer />
          </div>
        </div>
        <div className="Gray">
          <div className="BOttom">
            <NavContainer />
          </div>
        </div>


          <div className="app-wrapper-content">
             <Route path="/cart" render={ () => <div>Cart</div> }/>
             <Route path="/checkout" render={ () => <div>checkout</div> }/>
             <Route path="/index" render={ () => <div>index</div> }/>
             <Route path="/productpage" render={ () => <div>productpage</div> }/>
             <Route path="/shopCatGridx3" render={ () => <div>shopCatGridx3</div> }/>
          </div>
          <Footer/>
      </div>
    </BrowserRouter>  
  );
}

export default App;
